import './App.css';

function App() {
  const age = 17;
  const isGreen = true;
  return (
    <div className="App">
     {age >= 18 ? "OVER AGE" : "UNDER AGE"}
     <h1 style={{color: isGreen ? "green" : "red"}}></h1>
      </div>
  );
}

const User = (props) =>{
  return (
    <div>
      <h1> {props.name}</h1>
      <h1> {props.age}</h1>
    </div>
  )
}

export default App;
